import React from 'react';
import {Route as ReactDOMRoute, useHistory} from 'react-router-dom';

const Route = ({
    isprivate = false,
    component: Component,
    ...rest  
})=>{

    // const user = true;

    // if (isPrivate === !!) {
        
    // }

    return(
        <ReactDOMRoute {...rest}
        render={(props)=>{
          return (
              <Component {...props}/>
          )  
        }}
        />
    )
}
export default Route;
